import { Form, FormGroup, FormLabel, FormControl, FormText } from "react-bootstrap";
import Layout from '../components/layout'

class Login extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            username: ''
        }
    }

    handleChance = (event) => {
        this.setState({
            usename: event
        })
    }

    render() {
        return (
        <Layout>
            <div>

                <h1>Login Here</h1>
                <Form>
                    <FormGroup controlId="loginForm">
                        <FormLabel>Email Address</FormLabel>
                        <FormControl type="email"/>
                        <FormText className="text-muted" placeholder='Username'></FormText>
                    </FormGroup>
                </Form>
            </div>
        </Layout>
        )
    }

}

export default Login;
